function App(props) {
  return (
    <div>
      <NavBar />
      <Grid container spacing={16}
      style={{padding:"16px"}}>
      <Grid
container
spacing={0}
direction="column"
alignItems="center"
justify="center"
style={{ minHeight: '100vh' }}
>

          <Paper>
            <ToDo />
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
